import React, { Component } from 'react';
import axios from 'axios';
class App extends Component {
  constructor() {
    super();
    this.state = {
      ticker: '',
    };
  } componentDidMount(){
  axios.get('https://indodax.com/api/ticker/btcidr')
  .then((ambilData) => {
    console.log(ambilData);
    this.setState({
      data1: ambilData.data.ticker.last,
      data2: ambilData.data.ticker.low,
      data3: ambilData.data.ticker.high,
      data4: ambilData.data.ticker.vol_btc
    }) 
  })
};
render() {
  return (
    <div>
      <center>
        <h1>Tabel Bitcoin Market</h1>
        <p>Harga Terakhir : {this.state.data1}</p>
        <p>Low : {this.state.data2}</p>
        <p>High : {this.state.data3}</p>
        <p>Vol BTC : {this.state.data4}</p>
      </center>
    </div>
  );
}
}
export default App;
